	 		 -----------------------------------------------------------------------------*/
			if(listOrdersDTO!=null && listOrdersDTO.size()>0 && checkBoxPrintSignal!=null && checkBoxPrintSignal!=0L){
				//listOrdersDTO=(ArrayList<OrdersDTO>) session.getAttribute("listOrdersDTOReport");
